require("dotenv").config()
const CREATOR = 'Dark Yasiya'



async function status() {
    try {

        
        const status = "Server is runing"

        const result = {
            status: true,
            creator: CREATOR,
            status: status,
        
        };

        // console.dir(result, { depth: null, colors: true });
        return result

    } catch (error) {
        const errors = {
            status: false,
            creator: CREATOR,
            error: error.message
        };
        console.log(errors);
    }
}


module.exports = { status }
